import "./List.css";
const ListData = (props) => {
  const catg = props.fData.data;
  console.log(props.fData);
  let p = false;
  let path = "";
  if (props.fData.pageType == "product") {
    p = true;
    path = catg.foodImagepath
  }
  console.log(p);
  const clickedItem = (event) => {
    console.log(event.target.id);
  };

  return (
    <div>
      <ul class="list-group">
        {catg &&
          catg.length > 0 &&
          catg.map(
            (catg, index) => (
              console.log(catg),
              (
                <div className="list">
                  <li
                    class="list-group-item"
                    key={catg.id}
                    onClick={clickedItem}
                    id={catg.id}
                  >
                    <div className="row" id={catg.id}>

                      <img
                        className="image"
                        src={catg.foodImagepath}
                        alt="new"
                        id={catg.id}
                      />
                      <div className="text" id={catg.id}>
                        {p && catg.fullFoodName}
                        {!p && catg.name}
                      </div>
                    </div>
                  </li>
                </div>
              )
            )
          )}
      </ul>
    </div>
  );
};

export default ListData;
